      SELECT - col0 FROM tab1 (FORMAT parquet) WHERE NOT + + col0 / 92 * - - col1 NOT BETWEEN ( - + ( col0 ) ) AND - col0 * + + col2 - col2 + - - 74;
  - name: tab1

outputs:
  - name: q10769.out
    data: |
